import React, { useEffect, useState } from "react"

function Postres() {

    const [postres, setPostres] = useState([])

    useEffect(() => {
        fetch("data.json")
            .then(response => response.json())
            .then(datos => console.log(datos))
    }, [])

    return postres
}
